import React from "react"
import {Collapse} from "reactstrap";
import { Spinner } from 'reactstrap';

class Output extends React.Component{
    render(){
        if(this.props.output===null){

            return (
                <div style={{width:"100%",textAlign:"center",paddingTop:"40px",paddingBottom:"30px",marginTop:"30px",marginBottom:"30px"}}>
                    <Spinner style={{ width: '3rem', height: '3rem' }} type="grow"/>
                </div>
            );
            
        }
        if(this.props.output===""){
            return null;
        }
        return(
            // <Collapse isOpen={this.props.isoutput} >
                <div className="outputbox" style={{marginBottom:"20px"}}>
                    <div className="header">
                        <h4 style={{fontWeight:"300"}}>Output</h4>
                    </div>
                    <div className="outputarea">
                        <h6>CPU Time : {this.props.output.cpuTime} </h6>
                        <h6>Memory : {this.props.output.memory}</h6>
                        <h6>OUTPUT :</h6>
                        <text>{this.props.output.output}</text>
                        
                        {/* <textarea className="outputarea" style={{height:"80px",maxHeight:"280px",OverflowStyle:"-ms-autohiding-scrollbar",}} defaultValue={this.props.output.output}></textarea> */}
                    </div>
                </div>
            // </Collapse>
        );
    }
}
export default Output;
